import React from 'react';
import JavaIDE from './components/JavaIDE';
import './App.css';

import { BrowserRouter, Route, Link } from 'react-router-dom';
import ComponenteA from './ComponenteA';
import ComponenteB from './ComponenteB';

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/componenteA">Componente A</Link>
            </li>
            <li>
              <Link to="/componenteB">Componente B</Link>
            </li>
          </ul>
        </nav>

        <Route path="/componenteA" component={ComponenteA} />
        <Route path="/componenteB" component={ComponenteB} />
      </div>
    </BrowserRouter>
  );
};

export default App;
